import 'package:flutter/material.dart';

import 'Adherent.dart';
import 'add_adherent_page.dart';
import 'adherent_detail.dart';

class AdherentsPage extends StatefulWidget {
  @override
  _AdherentsPageState createState() => _AdherentsPageState();
}

class _AdherentsPageState extends State<AdherentsPage> {
  final List<Adherent> adherents = [
    Adherent(
      nom: 'bougendar',
      prenom: 'Anass',
      coverUrl: 'data:image/jpeg;base64,',
      email: '',
      telephone: "0661616116"
    ),
    Adherent(
      nom: 'Badri',
      prenom: 'Amine',
      coverUrl: 'data:image/webp;base64,', email: '',
      telephone: "0771717171"
    ),
  ];

  void _addAdherent(Adherent adherent) {
    setState(() {
      adherents.add(adherent);
    });
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text('Adhérents'),
      ),
      body: ListView.builder(
        itemCount: adherents.length,
        itemBuilder: (context, index) {
          final adherent = adherents[index];
          return ListTile(
            title: Text('${adherent.nom} ${adherent.prenom}'),
            leading: CircleAvatar(
              backgroundImage: NetworkImage(adherent.coverUrl),
            ),
            onTap: () {
              Navigator.push(
                context,
                MaterialPageRoute(builder: (context) => AdherentDetailPage(adherent: adherent)), // Navigation vers la page de détails de l'adhérent
              );
            },
          );
        },
      ),
      floatingActionButton: FloatingActionButton(
        onPressed: () {
          Navigator.push(
            context,
            MaterialPageRoute(builder: (context) => AddAdherentPage(onAddAdherent: _addAdherent)), // Navigation vers la page d'ajout d'adhérent
          );
        },
        child: Icon(Icons.add),
      ),
    );
  }
}
